import React, { Component } from 'react';
import {
  Button,
  Col,
  Navbar,
  NavbarBrand,
  Row,
  } from 'reactstrap';

import "../App.css"

class NavigationBarBottom extends Component {
  constructor(props) {
    super(props);

    this.toggle = this.toggle.bind(this);
    this.state = {
      isOpen: false
    };
  }
  toggle() {
    this.setState({
      isOpen: !this.state.isOpen
    });
  }

  render() {
    return (
    <Navbar className="navigationB" color="light fixed-bottom" light expand="md">
        <Row>
         <Col xs={6} sm={4} md={4} lg={4}>
          <NavbarBrand  href="/"><img src={require(`../assets/back.png`)} height="40px" alt="" /> </NavbarBrand>
         </Col>
         <Col xs={6} sm={4} md={4} lg={4}>
          <Button
           href="/signup"
           outline color="danger"
           size="lg"> Daftar Sekarang </Button>
         </Col>
        </Row>
    </Navbar>
    );
  }
}

export default NavigationBarBottom;
